import React, { useState, useEffect } from "react";
import { useNavigate } from 'react-router-dom';
import Manager_Product_List from "./Manager_Product_List";
import Manager_Add_Product from "./Manager_Add_Product";
import Manager_Orderding_List from "./Manager_Orderding_List";
import Manager_Profits from "./Manager_Profits";
import { Link, Outlet } from "react-router-dom";
import '../App.css';
// import '../App.html';
export default function Client_Nav(props) {
    const [mystyle, setMystyle] = useState({});
    let navigate=useNavigate();
    let session=JSON.parse(sessionStorage.getItem("currentuser")).cart;
    useEffect(() => {
        setMystyle({
            color: "#3aedff",
            fontSize: "20px", marginLeft: "330px",
            marginTop: "70PX"
        });
    }, []);
    return (
    <div>
        <div className="">
            <nav id="navs ">
                <a className="App-link" style={mystyle} onClick={()=>{navigate(`/client`,{state:{products:session}})}}>shopping-cartproduct-list</a>
                <Link className="App-link" style={mystyle} to={`/client/shopingCart`}></Link>
                {/* <Link className="App-link" style={mystyle} to={`/manager/orderingList`}>orderingList</Link> */}
                {/* <Link className="App-link" style={mystyle} to={`/manager/profits`}>profits</Link> */}
            </nav>
            <Outlet />
        </div>
      
    </div>);
}
